                "itinerary": "<h1 style=\"color:#000000;\">Manali, Sissu, Kasol & Manikaran Tour</h1>\n<p style=\"color:#333333;\"><strong>Greetings from SyncTrip!</strong></p>\n<p style=\"color:#333333;\">Join us for an unforgettable adventure to the hills, where scenic beauty meets spiritual peace and thrilling experiences!</p>\n\n<div style=\"background:#f9f9f9;padding:10px;border-left:4px solid #000000;margin-bottom:20px;\">\n  <h3 style=\"margin-top:0;color:#000000;\">Trip Starting Point:</h3>\n  <p style=\"color: black;\"><strong>Chandigarh Pickup Locations:</strong>\n    <a href=\"https://www.google.com/maps/search/?api=1&query=Sector+10+Chandigarh\" target=\"_blank\" style=\"color: black; text-decoration: underline;\">Sector 10</a>,\n    <a href=\"https://www.google.com/maps/search/?api=1&query=Sector+14+Chandigarh\" target=\"_blank\" style=\"color: black; text-decoration: underline;\">Sector 14</a>,\n    <a href=\"https://www.google.com/maps/search/?api=1&query=Sector+15+Chandigarh\" target=\"_blank\" style=\"color: black; text-decoration: underline;\">Sector 15</a>,\n    <a href=\"https://www.google.com/maps/search/?api=1&query=Sector+43+Chandigarh\" target=\"_blank\" style=\"color: black; text-decoration: underline;\">Sector 43</a>\n  </p>\n</div>\n\n<h2 style=\"color:#000000;\">Trip Dates</h2>\n<ul style=\"color:#333333;\">\n  <li><strong>May:</strong> 30 May-03 June</li>\n  <li><strong>June:</strong> 06-10 June, 13-17 June, 20-24 June</li>\n</ul>\n\n<h2 style=\"color:#000000;\">Day-wise Itinerary</h2>\n\n<h3 style=\"color:#000000;\">Day 1: Departure from Panjab University</h3>\n<ul style=\"color:#333333;\">\n  <li>9:00 PM – Departure from Panjab University at night</li>\n</ul>\n\n<h3 style=\"color:#000000;\">Day 2: Arrival in Manali, Local Sightseeing</h3>\n<ul style=\"color:#333333;\">\n  <li>Reach Manali by 9:00 AM</li>\n  <li>Hotel Check-in & rest for 3–4 hours</li>\n  <li>Evening sightseeing at Hadimba Mandir, Waterfall</li>\n  <li>Dinner at hotel</li>\n</ul>\n\n<h3 style=\"color:#000000;\">Day 3: Manali Sightseeing – Solang Valley, Atal Tunnel & Sissu</h3>\n<ul style=\"color:#333333;\">\n  <li>Breakfast at hotel</li>\n  <li>Full-day excursion to Solang Valley, Atal Tunnel, and Sissu</li>\n  <li>Return to hotel, DJ Night & Bonfire</li>\n  <li>Dinner at hotel</li>\n</ul>\n\n<h3 style=\"color:#000000;\">Day 4: Manali to Kasol & Manikaran (River Rafting*)</h3>\n<ul style=\"color:#333333;\">\n  <li>Breakfast at hotel</li>\n  <li>Proceed to Kasol and Manikaran</li>\n  <li>Start return journey in the evening</li>\n</ul>\n\n<h3 style=\"color:#000000;\">Day 5: Arrival in Chandigarh</h3>\n<ul style=\"color:#333333;\">\n  <li>6:00 AM – Reach Chandigarh</li>\n  <li>Tour ends with amazing memories ❤️</li>\n</ul>\n\n\n<h2 style=\"color:#000000;\">Inclusions</h2>\n<ul style=\"color:#333333;\">\n  <li>Travel via Tempo Traveller</li>\n  <li>2 Buffet Breakfasts & 2 Buffet Dinners</li>\n  <li>All Local Sightseeing</li>\n  <li>DJ Party</li>\n  <li>Bonfire</li>\n</ul>\n\n<p style=\"color:#333333;\"><em>*River rafting is subject to availability and weather conditions.</em></p>\n<p style=\"color:#333333;\"><em>Note: Hotels may vary based on room availability.</em></p>",
