                "numberOfPeopleApplied": 2,
                "itinerary": "<h1 style=\"color:#000000;\">Manali, Manikaran, Kasol & Vashisht Tour</h1>\n    <p style=\"color:#333333;\"><strong>Greetings from SyncTrip!</strong></p>\n    <p style=\"color:#333333;\">Embark on an unforgettable journey filled with adventure, scenic beauty, and spiritual tranquility.</p>\n\n    <div style=\"background:#f9f9f9;padding:10px;border-left:4px solid #000000;margin-bottom:20px;\">\n      <h3 style=\"margin-top:0;color:#000000;\">Trip Starting Point:</h3>\n      <p style=\"color: black;\"><strong>Chandigarh Pickup Locations:</strong>\n  <a href=\"https://www.google.com/maps/search/?api=1&query=Sector+10+Chandigarh\" target=\"_blank\" style=\"color: black; text-decoration: underline; \">Sector 10</a>, \n  <a href=\"https://www.google.com/maps/search/?api=1&query=Sector+14+Chandigarh\" target=\"_blank\" style=\"color: black; text-decoration: underline; \">Sector 14</a>, \n  <a href=\"https://www.google.com/maps/search/?api=1&query=Sector+15+Chandigarh\" target=\"_blank\" style=\"color: black; text-decoration: underline; \">Sector 15</a>, \n  <a href=\"https://www.google.com/maps/search/?api=1&query=Sector+43+Chandigarh\" target=\"_blank\" style=\"color: black; text-decoration: underline;\">Sector 43</a>\n</p>\n    </div>\n\n    <h2 style=\"color:#000000;\">Day-wise Itinerary</h2>\n\n    <h3 style=\"color:#000000;\">Day 1: Departure from Chandigarh</h3>\n    <ul style=\"color:#333333;\">\n      <li>10:30 PM – Assemble at the pickup point</li>\n      <li>11:00 PM – Start overnight journey to Manali via Tempo Traveller</li>\n    </ul>\n\n    <h3 style=\"color:#000000;\">Day 2: Arrival & Local Exploration</h3>\n    <ul style=\"color:#333333;\">\n      <li>Check-in at hotel (as per timing)</li>\n      <li>Visit Van Vihar, Hadimba Temple (on foot)</li>\n      <li>Afternoon – Visit Jogini Waterfall</li>\n      <li>Evening – Explore Mall Road</li>\n      <li>8:00–9:00 PM – Buffet Dinner</li>\n    </ul>\n\n    <h3 style=\"color:#000000;\">Day 3: Manali & Valley Excursion</h3>\n    <ul style=\"color:#333333;\">\n      <li>Breakfast Buffet</li>\n      <li>Local Manali sightseeing (on foot)</li>\n      <li>Visit Vashisht or Solang Valley & Sissu (as per road condition)</li>\n      <li>Evening – DJ Night & Bonfire</li>\n      <li>Dinner Buffet</li>\n    </ul>\n\n    <h3 style=\"color:#000000;\">Day 4: Spiritual & Adventure Escape</h3>\n    <ul style=\"color:#333333;\">\n      <li>Breakfast at hotel</li>\n      <li>Visit Manikaran Sahib Gurudwara, Hot Bath & Langar, Shiv Mandir</li>\n      <li>Proceed to Kasol – Riverside Trek (3–4 hrs)</li>\n      <li>Start journey back to Chandigarh in the evening</li>\n    </ul>\n\n    <h3 style=\"color:#000000;\">Day 5: Return to Chandigarh</h3>\n    <ul style=\"color:#333333;\">\n      <li>4:00 AM – Reach Chandigarh</li>\n      <li>Tour ends with beautiful memories ❤️</li>\n    </ul>\n\n    <h2 style=\"color:#000000;\">Accommodation & Pricing</h2>\n    <table style=\"width:100%;border-collapse:collapse;margin:20px 0;\">\n      <thead>\n        <tr>\n          <th style=\"border:1px solid #ddd;padding:12px;background-color:#000000;color:white;\">Room Sharing</th>\n          <th style=\"border:1px solid #ddd;padding:12px;background-color:#000000;color:white;\">Price (INR)</th>\n        </tr>\n      </thead>\n      <tbody>\n        <tr>\n          <td style=\"border:1px solid #ddd;padding:12px;text-align:center;\">Quad (4 members/room)</td>\n          <td style=\"border:1px solid #ddd;padding:12px;text-align:center;\">₹4,999/-</td>\n        </tr>\n        <tr>\n          <td style=\"border:1px solid #ddd;padding:12px;text-align:center;\">Triple (3 members/room)</td>\n          <td style=\"border:1px solid #ddd;padding:12px;text-align:center;\">₹5,799/-</td>\n        </tr>\n        <tr>\n          <td style=\"border:1px solid #ddd;padding:12px;text-align:center;\">Double (2 members/room)</td>\n          <td style=\"border:1px solid #ddd;padding:12px;text-align:center;\">₹6,399/-</td>\n        </tr>\n      </tbody>\n    </table>\n    <p style=\"color:#333333;\"><em>Note: Everyone above the age of 3 and occupying a seat will be counted as a major member.</em></p>\n<h2 style=\"color:#000000;\">Inclusions</h2>\n    <ul style=\"color:#333333;\">\n      <li>Travel via Tempo Traveller</li>\n      <li>2 Buffet Breakfasts & 2 Buffet Dinners</li>\n      <li>All Local Sightseeing</li>\n      <li>DJ Party</li>\n      <li>Bonfire</li>\n    </ul>\n<p style=\"color:#333333;\"><em>Note: The hotels to stay at might changes based on availablity of rooms.</em></p>\n ",
